import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import {showCallPage} from "../../../redux/action";
import Tab from "react-bootstrap/Tab";
import Device from "../device";


const ExtensionsList = (props) => {
    const devicesData = useSelector(state => state.devicesData);
    const loginData = useSelector(state => state.loginData);
    const [is, getId] = useState('')
    const checkOwnerId = (item) => {
        console.log("item", item)

        if (loginData.item !== undefined) {
            let id = loginData.item[0].data.owner_id;
            const finedItem = item.filter((i) => (id === i[0].owner_id));
            console.log("finedItem", finedItem)
            if (finedItem) return true;
            else return false
        }

    };
    useEffect(() => {
        if (devicesData.item !== undefined) {
            checkOwnerId(devicesData.item[0])

        }

    }, [loginData])
    return (
        <React.Fragment>
            <ul> {
                devicesData.item === undefined ? null : devicesData.item[0].map((item, i) => {
                    return (
                        <li key={i}>
                            <Device/>
                        </li>
                    )

                })
            }</ul>

        </React.Fragment>
    )
};


export default ExtensionsList;
